def δ (x : ℕ) : ℕ :=
  if hx : x > 0 then
    let divisors := {d ∈ Nat.divisors x | d % 2 = 1}
    Finset.max' divisors (Finset.nonempty_of_mem (Finset.mem_filter.mpr ⟨Nat.divisor_self hx, Nat.odd_one⟩))
  else 0

def δ (x : ℕ) : ℕ :=
  if x = 0 then 0 else
  Nat.findGreatest (fun d => d ∣ x ∧ d % 2 = 1) x
